import { PostCard } from "../PostCard"

export const Posts = () => (
    <div className="posts">
            <h1>{counter}</h1>
                {posts.map(post => (
                  <PostCard 
                    key={post.id}
                    title={post.title} 
                    body={post.body} 
                    id={post.id} 
                    cover={post.cover}
                  />
                ))}
    </div>
)
